`,l.jsxs(t.ul,{children:[`
`,l.jsx(t.li,{children:"The artwork and characters feel very Nepali"}),`
`,l.jsx(t.li,{children:"It's not luck-based."}),`
`,l.jsx(t.li,{children:"Every game plays out differently  high replayability"}),`
`,l.jsx(t.li,{children:"Once you learn it, it's all about reading people, not rules"}),`
`]}),`
