`,l.jsx(t.p,{children:"Marriage (aka Nepali Taas) uses three decks, and each player gets 21 cards. The goal: build valid sets  like pure sequences, dublee (pairs), and special combos like Marriage (Tiplu, Jhiplu, Poplu). There's a joker for every round, but you only find out what it is after meeting a few conditions."}),`
