`,l.jsx(t.p,{children:"Board games in Nepal, especially in Kathmandu, are no longer just for kids."}),`
`,l.jsx(t.p,{children:"These days, you can spot people playing all kinds of games in different corners of the city. Walk into a local chiya pasal and you might see at least one group deep into an online game of Ludo."}),`
`,l.jsx(t.p,{children:"In the past few years, game nights have popped up in cafs, bars, and even offices. People now meet not just to eat, but to sit around a table, laugh, and PLAY."}),`
`,l.jsx(t.p,{children:"If you've been searching for board games in Nepal or wondering where to play, this guide is for you. Here's a tour of game nights, cafs with games, and local Nepali board games you can buy."}),`
`,l.jsx(t.h2,{children:"1. Board Game Nights in Nepal"}),`
`,l.jsx(t.h3,{children:"Tumlet Game Nights"}),`
`,l.jsx(t.p,{children:"Tumlet is a Nepali board game brand that makes games for young adults with high replay value. We want to grow the board game culture in Nepal, so we host free game nights every month."}),`
`,l.jsx(t.p,{children:"We bring a mix of games (Nepali and bestsellers) for different tastes and love teaching them to new players. You can meet people, try games you've never seen before, and spark new connections."}),`
`,l.jsx(t.p,{children:"Or just play for the fun of it."}),`
